import React from 'react';
import './index.css'

const myAlert = () => {

    return(
        alert( <h1>hiiiiii</h1>)
    )

}


function Nav() {
    return (
        <>
            <nav className="nav">
                <div className="nav-div1">
                    <ul>
                        <li>Home</li>
                        <li>About</li>
                        <li>Contact</li>
                        <li>Help</li>
                    </ul>
                </div>
                <div className="nav-div2">
                    <span onClick={myAlert} ><a>Signup</a></span>

                    <span><a>SignIn</a></span>
                </div>
            </nav>


        </>



    )
}

export default Nav
